package GUI;

import SetGame.Set;
import javafx.fxml.FXML;
import javafx.scene.control.Label;
import javafx.scene.control.ToggleButton;
import javafx.scene.layout.ColumnConstraints;
import javafx.scene.layout.RowConstraints;
import javafx.stage.Screen;

public class MainController {
    public Label MainLabel;

    @FXML
    protected void startGame(){
        GUI.startGame();
        Set.initiateGame();
    }

    protected void buttonHandler(int button){
        GUI.setTbBackground(GUI.buttons.get(button), "data:image/jpeg;base64,");
        Set.addInput(button);
    }

    @FXML
    protected void changeLabel(String s){
        MainLabel.setText(s);
    }

    @FXML
    protected void submit(){
        MainLabel.setText(Set.submitInputs());
    }

    @FXML
    protected void reset(){
        for (ToggleButton tb : GUI.buttons){
            GUI.setTbBackground(tb, "data:image/jpeg;base64,");
        }
    }
    @FXML
    protected void b0Pressed() {
        buttonHandler(0);
    }

    @FXML
    protected void b1Pressed() {
        buttonHandler(1);
    }

    @FXML
    protected void b2Pressed(){
        buttonHandler(2);
    }
    @FXML
    protected void b3Pressed(){
        buttonHandler(3);
    }
    @FXML
    protected void b4Pressed(){
        buttonHandler(4);
    }
    @FXML
    protected void b5Pressed(){
        buttonHandler(5);
    }
    @FXML
    protected void b6Pressed(){
        buttonHandler(6);
    }
    @FXML
    protected void b7Pressed(){
        buttonHandler(7);
    }
    @FXML
    protected void b8Pressed(){
        buttonHandler(8);
    }
    @FXML
    protected void b9Pressed() {
        buttonHandler(9);
    }
    @FXML
    protected void b10Pressed(){
        buttonHandler(10);
    }
    @FXML
    protected void b11Pressed(){
        buttonHandler(11);
    }
    @FXML
    protected void b12Pressed(){
        buttonHandler(12);
    }
    @FXML
    protected void b13Pressed(){
        buttonHandler(13);
    }
    @FXML
    protected void b14Pressed(){
        buttonHandler(14);
    }
}